import React, { useState, useEffect, useCallback } from 'react';
import axios from 'axios';
import { FaFileAlt, FaDownload, FaEye } from 'react-icons/fa';
import { Link } from 'react-router-dom';

function ResumeList() {
  const [resumes, setResumes] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState('');
  
  const API_URL = process.env.REACT_APP_API_URL || 'http://localhost:5000/api';

  const fetchResumes = useCallback(async () => {
    try {
      const response = await axios.get(`${API_URL}/resumes/`);
      setResumes(response.data);
    } catch (error) {
      setError('Error fetching resumes. Please try again later.');
      console.error('Fetch error:', error);
    } finally {
      setLoading(false);
    }
  }, [API_URL]);

  useEffect(() => {
    fetchResumes();
  }, [fetchResumes]);

  const handleDownload = async (resumeId) => {
    try {
      // Use a direct href with the API URL for download
      window.open(`${API_URL}/resumes/${resumeId}/download/`, '_blank');
    } catch (error) {
      setError('Error downloading resume. Please try again.');
      console.error('Download error:', error);
    }
  };

  const formatDate = (dateString) => {
    if (!dateString) return '';
    const date = new Date(dateString);
    return date.toLocaleDateString() + ' ' + date.toLocaleTimeString();
  };

  if (loading) {
    return <div className="text-center py-8">Loading resumes...</div>;
  }

  if (error) {
    return <div className="text-center text-red-600 py-8">{error}</div>;
  }

  return (
    <div className="max-w-4xl mx-auto">
      <h2 className="text-2xl font-bold text-gray-800 mb-6">Parsed Resumes</h2>
      {resumes.length === 0 ? (
        <div className="bg-white p-6 rounded-lg shadow-md text-center">
          <p className="text-gray-600">No resumes found.</p>
          <Link 
            to="/upload" 
            className="inline-block mt-4 px-4 py-2 bg-blue-600 text-white rounded-lg hover:bg-blue-700"
          >
            Upload a Resume
          </Link>
        </div>
      ) : (
        <div className="space-y-4">
          {resumes.map((resume) => (
            <div
              key={resume.id}
              className="bg-white p-6 rounded-lg shadow-md hover:shadow-lg transition-shadow"
            >
              <div className="flex items-center justify-between">
                <div className="flex items-center">
                  <FaFileAlt className="h-6 w-6 text-gray-400 mr-3" />
                  <div>
                    <h3 className="text-lg font-semibold text-gray-800">
                      {resume.name || 'Unnamed Resume'}
                    </h3>
                    <p className="text-sm text-gray-600">
                      {resume.filename}
                    </p>
                    <p className="text-sm text-gray-600">
                      Uploaded on: {formatDate(resume.uploaded_at)}
                    </p>
                  </div>
                </div>
                <div className="flex space-x-2">
                  <button
                    onClick={() => handleDownload(resume.id)}
                    className="flex items-center px-3 py-1.5 bg-blue-600 text-white rounded-lg hover:bg-blue-700 transition-colors"
                    title="Download original resume"
                  >
                    <FaDownload className="mr-2" />
                    Download
                  </button>
                </div>
              </div>
              <div className="mt-4">
                <div className="grid grid-cols-2 gap-4">
                  <div>
                    <p className="text-sm text-gray-600">Email: {resume.email}</p>
                    <p className="text-sm text-gray-600">Phone: {resume.phone}</p>
                    <p className="text-sm text-gray-600">
                      Education: {resume.education}
                    </p>
                  </div>
                  <div>
                    <p className="text-sm text-gray-600">
                      Experience: {resume.experience} years
                    </p>
                    <p className="text-sm text-gray-600">Location: {resume.location}</p>
                    <p className="text-sm text-gray-600">
                      Skills: {resume.skills && resume.skills.join(', ')}
                    </p>
                  </div>
                </div>
              </div>
            </div>
          ))}
        </div>
      )}
    </div>
  );
}

export default ResumeList;
